import "./App.css";
import React from "react";
import Today from "./Components/Today";
import Forecast from "./Components/Forecast";
import { Container, Navbar } from "react-bootstrap";
import { Route, Router, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Navbar bg="dark" variant="dark">
        <Container>
          <Navbar.Brand href="#today">Weather Mood</Navbar.Brand>
        </Container>
      </Navbar>
      <Routes>
        <Route path="./Components/Today.js" element={Today} />
        <Route path="./Components/Forecast.js" element={Forecast} />
      </Routes>
    </div>
  );
}

export default App;
